	(8480000865977, 'Lasaña a la boloñesa Hacendado ultracongelada', 'https://prod-mercadona.imgix.net/images/23d69c3487aee681deb6e957ecc0b3f6.jpg?fit=crop&h=600&w=600', 'Agua, carnes (17%) de cerdo y vacuno, leche pasteurizada, sémola de trigo, concentrado de tomate, cebolla (5%), quesos (leche pasteurizada, sal, fermentos lácticos, coagulante microbiano, colorante (E-160b(ii)), endurecedor (E-509)), tomate (2%), zumo de tomate,  harina de trigo, aceite de girasol, almidón modificado, zanahoria, bebida espirituosa, gelatina, azúcar, sal, pan rallado (harina de trigo, agua, sal y levadura), clara de huevo en polvo, especias, gluten de trigo. Contiene gluten, huevo, leche. Puede contener trazas de: crustáceos, pescado, soja, mostaza, moluscos.', 'Hacendado', 0, 0),
	(8480000866004, 'Canelones de carne con bechamel Hacendado ultracongelados', 'https://prod-mercadona.imgix.net/images/7a8785b9c26576487b08e5a0e19f141c.jpg?fit=crop&h=600&w=600', 'Agua, leche pasteurizada, carnes (24%) de pollo y cerdo, sémola de trigo, cebolla (6%), quesos (leche pasteurizada, sal, fermentos lácticos, coagulante microbiano, colorante (E-160b(ii)), endurecedor (E-509)), harina de trigo, tomate (2%), aceite de girasol, zumo de tomate, almidón modificado, bebida espirituosa, pan rallado (harina de trigo, agua, sal y levadura), vino de licor, sal, especias, salsa de soja (agua, soja, trigo, sal), clara de huevo en polvo, gluten de trigo. Contiene gluten, huevo, soja, leche. Puede contener trazas de: crustáceos, pescado, mostaza, moluscos.', 'Hacendado', 0, 0),
	(8480000866011, 'Canelones de carne con bechamel Hacendado ultracongelados', 'https://prod-mercadona.imgix.net/images/d0455733d2efd2ae70be5b388a40de0f.jpg?fit=crop&h=600&w=600', 'Carnes (26%) de pollo y cerdo, agua, leche pasteurizada, sémola de trigo, cebolla (7%), queso, harina de trigo, tomate (2%), aceite de girasol, zumo de tomate, bebida espirituosa, almidón modificado, pan rallado (harina de trigo, agua, sal y levadura), vino de licor, sal, especias, salsa de soja (agua, soja, trigo, sal), clara de huevo en polvo, gluten de trigo. Contiene gluten, huevo, soja, leche. Puede contener trazas de: crustáceos, pescado, mostaza, moluscos.', 'Hacendado', 0, 0),
