	(8480000867025, 'Cerveza Clásica Steinburg', 'https://prod-mercadona.imgix.net/images/06f788943946c4dbf1b25ba623a5727e.jpg?fit=crop&h=600&w=600', 'Contiene malta de cebada', 'Steinburg', 1, 0),
