	(8593868005833, 'Cerveza artesana La Sagra Bohemia lata 33 cl.', 'https://static.carrefour.es/hd_510x_/img_pim_food/519194_00_1.jpg', 'Agua, malta de cebada, lúpulo y levadura.', 'SAGRA', 1, 0),
